import React from 'react';

const Lang = () => {
    return (
        <div>
            <div className="header">
                <h1>Language Detector &#12953;</h1>
            </div>
            <div className="box">
                <input type="text" placeholder="Your Text Here..." required autocomplete="off"/><br/>
                <button type="submit">Find</button>
            </div>
        </div>
    )
}

export default Lang;
